import React, { Component } from "react";
// import NotePage from "../components/NotePage";
import MyTabPanel from "../components/MyTabPanel";
import NewNote from "../components/NewNote";
import data from "../data/data";
import { Form, FormGroup, Input } from "reactstrap";
import {
  TabContent,
  TabPane,
  Nav,
  NavItem,
  NavLink,
  Card,
  Button,
  CardTitle,
  CardText,
  Row,
  Col,
} from "reactstrap";

class App extends Component {
  constructor() {
    super();
    this.state = {
      currentNoteID: null,
      currentNote: null,
      notes: null,
    };
  }

  render() {
    return (
      <>
        <MyTabPanel />

        <Card body>
          <CardTitle>{data["Learn React"][0].title}</CardTitle>
          <CardText>
            <Form>
              <FormGroup>
                <Input
                  type="textarea"
                  name="text"
                  id="notes"
                  placeholder="cd to the project directory\nnpx create-react-app project-name\ncd project-name\nnpm start"
                />
              </FormGroup>
            </Form>
          </CardText>
        </Card>
        <div>
          <NewNote />
        </div>
      </>
    );
  }
}

export default App;
